import React, { useState, useEffect } from 'react';
import { Table, Button } from 'react-bootstrap';
import axios from 'axios';

const VagasTable = () => {
  const [vagas, setVagas] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fazendo a requisição GET
        const response = await axios.get('http://localhost:4000/api/vagas');
        console.log('Dados recebidos:', response.data);
        setVagas(response.data);
      } catch (error) {
        console.error('Erro ao realizar a requisição:', error);
        // Tratando a resposta de erros
        if (error.response) {
          // O servidor respondeu com um status fora do intervalo 2xx
          console.error('Detalhes do erro:', error.response.status, error.response.data);
        } else if (error.request) {
          // A requisição foi feita mas não houve resposta
          console.error('Nenhuma resposta recebida:', error.request);
        } else {
          // Algum outro erro ocorreu na configuração da requisição
          console.error('Erro na configuração da requisição:', error.message);
        }
      }
    };
  
    fetchData();
  }, []); // Dependências vazias significam que este efeito rodará apenas uma vez após o componente montar.
  
      

  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>Código</th>
          <th>Salário</th>
          <th>Cidade</th>
          <th>Quantidade</th>
        </tr>
      </thead>
      <tbody>
        {vagas.map((vaga) => (
          <tr key={vaga.pk_vaga_codigo}>
            <td>{vaga.vaga_codigo}</td>
            <td>{vaga.vaga_salario}</td>
            <td>{vaga.vaga_cidade}</td>
            <td>{vaga.vaga_quantidade}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

export default VagasTable;
